// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CertificateVerification {

    address public owner;

    // Struct to represent a student
    struct Student {
        string name;
        uint256 rollNumber;
        bool exists;
    }

    // Struct to represent an issuer
    struct Issuer {
        string name;
        address issuerAddress;
        bool exists;
    }

    // Struct to represent a certificate
    struct Certificate {
        uint256 rollNumber;
        address issuerAddress;
        bool isValid;
    }

    // Mapping to store students
    mapping(uint256 => Student) public students;

    // Mapping to store issuers
    mapping(address => Issuer) public issuers;

    // Mapping to store certificates
    mapping(bytes32 => Certificate) public certificates;

    // Event triggered when a new student is added
    event StudentAdded(uint256 rollNumber, string name);

    // Event triggered when a new issuer is added
    event IssuerAdded(address issuerAddress, string name);

    // Event triggered when a certificate is issued
    event CertificateIssued(uint256 rollNumber, address issuerAddress, bool isValid);

    // Modifier to ensure that only the owner can execute certain functions
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    // Modifier to ensure that only registered issuers can issue certificates
    modifier onlyIssuer() {
        require(issuers[msg.sender].exists, "Only registered issuers can issue certificates");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // Function to add a new student
    function addStudent(uint256 _rollNumber, string memory _name) public onlyOwner {
        require(!students[_rollNumber].exists, "Student already exists");
        students[_rollNumber] = Student(_name, _rollNumber, true);
        emit StudentAdded(_rollNumber, _name);
    }

    // Function to add a new issuer
    function addIssuer(address _issuerAddress, string memory _name) public onlyOwner {
        require(!issuers[_issuerAddress].exists, "Issuer already exists");
        issuers[_issuerAddress] = Issuer(_name, _issuerAddress, true);
        emit IssuerAdded(_issuerAddress, _name);
    }

    // Function to issue a certificate
    function issueCertificate(uint256 _rollNumber) public onlyIssuer {
        require(students[_rollNumber].exists, "Student does not exist");
        bytes32 certificateId = keccak256(abi.encodePacked(_rollNumber, msg.sender));
        certificates[certificateId] = Certificate(_rollNumber, msg.sender, true);
        emit CertificateIssued(_rollNumber, msg.sender, true);
    }

    // Function to verify a certificate
    function verifyCertificate(uint256 _rollNumber, address _issuerAddress) public view returns (bool) {
        bytes32 certificateId = keccak256(abi.encodePacked(_rollNumber, _issuerAddress));
        return certificates[certificateId].isValid;
    }
}
